import React from 'react'
import styled from 'styled-components';

const InfoBox = styled.div`

`

const Text = styled.span`
  font-size : 20px;
  padding: 0 20px 0 20px;
`;

const Myimg = styled.span`
    background: black;
    width: 5rem;
    height: 5rem;
`;

function MyPage1() {
    return (
        <>
            <span>
                <Text>이름 <br /><br /></Text>
                <Text>핸드폰 <br /><br /></Text>
                <Text>이메일 <br /><br /></Text>
            </span>
                <Myimg />
        </>
    )
}

export default MyPage1
